INSERT INTO `categorias` VALUES (1,'Tees','Tees','SHORT SLEEVE TEES\r\n\r\n5.3 oz preshrunk 100% heavyweight cotton\r\nDouble-needle sleeve and bottom hems\r\nTaped neck and shoulders\r\n7/8\" rib collar\r\nClassic fit \r\nSewn in Label\r\nUnisex sizing\r\nNo two shirts are exactly alike. Enjoy each for its own uniqueness. \r\nWash separately\r\n','8f1771f63d6e06178e1ed1c99933a8cf.jpg',1,'2025-05-01'),(2,'Crewneck','Crewneck','CREW NECK FLEECE\r\nUpdate: Transitioning from 80% ring spun cotton, 20% polyester to 60% ringspun cotton face, 40% polyester \r\n8.5 oz.\r\n1x1 ribbed cuffs and waistband with spandex\r\nSofter feel and reduced pilling\r\nClassic fit \r\nSewn on Label\r\nUnisex sizing\r\nNo two crew neck fleece  are exactly alike. Enjoy each for its own uniqueness. \r\nWash separately\r\n','f7a1a2b5d8ccbc35c59234c1b8718cbc.jpg',0,'2025-05-01'),(3,'Crop-Hoodie','Crop Hoodie','CROP HOODIES\r\nUpdate: Transitioning from 6.5 oz. 80% ring spun cotton, 20% polyester to 60% ringspun cotton face, 40% polyester \r\nRaw edge at waist\r\nDyed-to-match drawcord\r\nDropped shoulder\r\nRibbed cuffs\r\nSide seam\r\nRelaxed fit\r\nSewn in Label\r\nNo two hoodies are exactly alike. Enjoy each for its own uniqueness. \r\nWash separately\r\n','700a1515f121b03fa5ddb8766502cb01.jpg',0,'2025-05-01'),(4,'Denim-Jackets','Denim Jackets','TIE DYE JACKET\r\n12 oz., 99% combed ringspun cotton, 1% spandex\r\nClassic denim jacket tie-dyed\r\nChest pockets with button flap closure\r\nLoose Fit\r\nUnisex sizing\r\nEnlarged print space on the back\r\n','ae82ef4ebbccbb1a918e54f5bb466e96.jpg',1,'2025-05-01'),(5,'Jogger','Jogger','JOGGERS\r\n\r\n8.25 oz. \r\n80% ring spun cotton 20% polyester. \r\nClassic fit \r\nDouble-needle stitching throughout\r\nbig pocket for extra carry\r\nSofter feel \r\nSewn on Label\r\nUnisex sizing\r\nNo two joggers are exactly alike. Enjoy each for its own uniqueness. \r\nWash separately\r\n','e25acf25537d6c11325c0e09d9f380f1.jpg',1,'2025-05-01'),(6,'Kids','Kids','100% Cotton Classic Fit Infant and Toddler Apparel with Unique Design\r\n\r\nMade from 100% high-quality cotton, these infant and toddler garments—whether the baby creeper or the toddler tee—feature a classic fit, reinforced seams for durability, and details designed for everyday comfort. Each piece is individually treated, making every item one-of-a-kind. Wash separately to preserve its unique character and color.','583751fe2dfbc9ce10979ab590315a9b.jpg',0,'2025-05-01'),(7,'long-Sleeve','Long Sleeve','LONG SLEEVE T-SHIRT\r\n5.3 oz preshrunk 100% heavyweight cotton\r\nDouble-needle bottom hem\r\nRib cuffs\r\nTaped neck and shoulders\r\n7/8\" rib collar\r\nClassic fit \r\nSewn in Label\r\nUnisex sizing\r\nNo two long sleeve T-shirts are exactly alike. Enjoy each for its own uniqueness. \r\nWash separately\r\n','0bc9a0af9b598612718b1524614e342e.jpg',1,'2025-05-01'),(8,'Pullovers','Pullovers','PULLOVER HOODIE\r\n\r\nUpdate: Transitioning from 80% ring spun cotton, 20% polyester to 60% ringspun cotton face, 40% polyester\r\n8.5oz\r\nDouble-needle stitching throughout\r\n1x1 ribbed cuffs and waistband with spandex\r\nDouble-lined hood for added warmth with matching drawstring\r\nPouch pocket for extra carry\r\nSofter feel and reduced pilling\r\nClassic fit \r\nSewn on Label\r\nUnisex sizing\r\nNo two hoodies are exactly alike. Enjoy each for its own uniqueness. \r\nWash separately\r\n','698c939247f479e52f2f4683036d9732.jpg',0,'2025-05-01'),(9,'Tank-Tops','Tank Tops','UNISEX TANKS\r\n5.3 oz. pre-shrunk 100% cotton \r\nClassic fit \r\nDouble-needle stitching throughout\r\nSewn on Label\r\nNo two tank tops are exactly alike. Enjoy each for its own uniqueness. \r\nWash separately \r\n','71ba06af75d33ecba69f76311e24fffd.jpg',0,'2025-05-01'),(10,'Accesories','Accesories','Unique and Durable Accessories to Complement Every Look\r\n\r\nCrafted with care and attention to detail, our accessories are designed to add personality and function to any outfit. Each piece is made to stand out, with no two items exactly alike—ensuring a truly one-of-a-kind touch. Built for durability and style, they’re perfect for everyday use. Wash or clean separately to maintain their unique appearance.','2944bbb25e7904d6be71f92bec1aedaf.jpg',0,'2025-05-01');
